// Signin.jsx
import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import '../assets/App.css'; // Import CSS for styling

const Signin = () => {
  const navigate = useNavigate(); // Importing useNavigate hook

  const handleRegisterClick = () => {
    navigate('/register'); // Navigate to register page
  };


  const signnot=()=>{
    return(
      <div className="signin-container">
          <div className="signin-content">
            <h2>Sign In</h2>
            <form>
              {/* Add your sign-in form fields here */}
              <input type="text" placeholder="Username" required />
              <input type="password" placeholder="Password" required />
              <button type="submit">Sign In</button>
            </form>
            <p>Don't have an account? <Link to="/register">
              Register here
              <div className="register-button">
                <button onClick={handleRegisterClick}>Register</button>
              </div>
            </Link></p>
          </div>
        </div>
    );
  }

  const signInComponent=()=>{
    return(
      <div className="bg-gray-100 min-h-screen flex justify-center items-center">
      <div className="max-w-md w-full bg-white p-8 rounded-lg shadow-lg">
        <h2 className="text-3xl font-semibold text-center mb-6">Sign In</h2>
        <form className="space-y-4">
          <input
            type="text"
            placeholder="Username"
            required
            className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:outline-none focus:border-blue-500"
          />
          <input
            type="password"
            placeholder="Password"
            required
            className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:outline-none focus:border-blue-500"
          />
          <button
            type="submit"
            className="w-full bg-blue-500 text-white py-2 rounded-lg hover:bg-blue-600 transition duration-300"
          >
            Sign In
          </button>
        </form>
        <p className="text-center mt-4">
          Don't have an account?{' '}
          <Link to="/register" className="text-blue-500">
            Register here
          </Link>
        </p>
        <div className="text-center mt-2">
          <button
            onClick={handleRegisterClick}
            className="text-blue-500 underline hover:text-blue-600 focus:outline-none"
          >
            Register
          </button>
        </div>
      </div>
    </div>
    );
  }

  return (
    <div className='booking_area w-full h-80 bg-gradient'>
      <div className="max-w-6xl w-full px-4 lg:px-0 mx-auto">
        {signInComponent}
      </div>
    </div>
  );
};

export default Signin;
